css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("facebook.com") {
* {
    background-color: #222 !important;
    color: #ccc !important;
    border-color: #222 !important;
}
#presence_ui {background:transparent!important;}
#pageLogo a {background-color: #444!important; background-image: url(data:image/png;base64,)!important;}
#blueBar {background-color: #444!important;}
#headNavOut {background-color: #666!important;}
#jewelAlert{background-position: -78px -137px !important;}
#jewelMail{background-position: -78px -73px !important;}
#jewelRequest{background-position: -78px -105px !important;}
#jewelCase {background-color: #444 !important;}
.jewel a {background-color: #444 !important;}
#jewelCase .jewel{float:left;height:31px;margin:13px -1px 0 0;position:relative;width:24px;border-top-width: 0px!important;border-right-width: 0px!important;border-bottom-width: 0;border-left-width: 0px!important;border-top-style: solid;border-right-style: solid;border-bottom-style: solid;border-left-style: solid;border-top-color: #3b5998;border-right-color: #3b5998;border-bottom-color: #3b5998;border-left-color: #3b5998;}
.jewelToggler{background:no-repeat url(data:image/png;base64,)!important;display:inline-block;height:31px;position:absolute;text-decoration:none;width:24px;}
#pageNav li a {background: #666 !important;}
.UIButton_Text {background: transparent !important; color: #ccc!important;}
.UIButton_Text:hover {color:white !important;}
.UIButton:hover, .UIButton:active {background: #748cab !important;-moz-border-radius: 3px !important;color:white !important;}
}
